import React from 'react';
import './Intro.scss'

export default function Intro() {

  return (
    <div className="Intro">

      <div className="text-container">
        <div className="logo-container">
          <img className="logo" src="https://furthermore-cdn.equinox.com/source-of-strength/static/media/concentrate-white.png"/>
        </div>
        <p className="presents">presents</p>
          <h1 className="header"><span className="break">my source</span><span className="break-mobile">of</span> strength</h1>
          <p className="subcopy">Athletes strengthen their muscles with weight training, running, cycling, and other fit pursuits. But fortifying the skin is just as key to giving them the holistic wellbeing and confidence required to excel in all areas of their lives. That’s why Furthermore partnered with La Mer for the launch of The Concentrate, a scientifically-developed treatment with anti-inflammatory and healing properties. Get inspired by the stories of three physically and mentally strong high performers below—then, tell us: What’s your source of strength?</p>
      </div>
    </div>
  )
}
